    public final static int
           NUM_STATES        = 524,
           NT_OFFSET         = 123,
           LA_STATE_OFFSET   = 5783,
           MAX_LA            = 2147483647,
           NUM_RULES         = 534,
           NUM_NONTERMINALS  = 195,
           NUM_SYMBOLS       = 318,
           SEGMENT_SIZE      = 8192,
           START_STATE       = 2897,
           IDENTIFIER_SYMBOL = 0,
           EOFT_SYMBOL       = 121,
           EOLT_SYMBOL       = 121,
           ACCEPT_ACTION     = 4849,
           ERROR_ACTION      = 5249;

